var resultTable = {};
resultTable[1] = new Array(resultStrTableStart+"<img src='images/gifs/methane.gif' width='390'><td class='mark' colspan='6'><b>Methane</b> is a colorless odorless gas. The relative abundance of methane on Earth makes it an attractive fuel, though capturing and storing it poses challenges due to its gaseous state under normal conditions for temperature and pressure. Methane is emitted by natural sources such as wetlands and from industry, agriculture, and waste management activities. It is one of the primary greenhouse gases. Globally, over 60% of total methane emissions come from human activities.</tr></table>");
resultTable[2] = new Array(resultStrTableStart+"<img src='images/gifs/methanol.gif' width='390'><td class='mark' colspan='6'><b>Methanol</b> is also known as methyl alcohol, wood alcohol, wood naphtha or wood spirits. It is a colorless, toxic flammable liquid. Methanol is often called wood alcohol because it was once produced chiefly as a byproduct of the destructive distillation of wood.  Nowadays, it is released to the environment during industrial uses and naturally from volcanic gases, vegetation, in the anaerobic metabolism of many varieties of bacteria and microbes.</tr></table>");
resultTable[3] = new Array(resultStrTableStart+"<img src='images/gifs/ethanol.gif' width='390'><td class='mark' colspan='6'><b>Ethanol</b> is a clear, colorless liquid, rapidly absorbed from the gastrointestinal tract and distributed throughout the body. It has bactericidal activity and is used often as a topical disinfectant. It is widely used as a solvent and preservative in pharmaceutical preparations as well as serving as the primary ingredient in alcoholic beverages. Due to its low freezing point, it is also the active fluid in many alcohol thermometers. Ethanol is a neurotoxic, psychoactive drug, and one of the oldest recreational drugs. Finally, ethanol is also a renewable fuel made from various plant materials collectively known as 'biomass.'</tr></table>");
resultTable[4] = new Array(resultStrTableStart+"<img src='images/gifs/ethene.gif' width='390'><td class='mark' colspan='6'><b>Ethene</b> or <b>Ethylene</b> is a colorless gas with a sweet odor and taste. It is lighter than air. It is easily ignited and a flame can easily flash back to the source of the leak. Under prolonged exposure to fire or heat the containers may rupture violently and rocket. Can cause explosion. Some fruit produce small amounts of ethane with ripening; it is considered an aging hormone in plants.</tr></table>");
resultTable[5] = new Array(resultStrTableStart+"<img src='images/gifs/EthanoicAcid.gif' width='390'><td class='mark' colspan='6'><b>Ethanoic acid</b> or <b>Acetic acid</b>, glacial is a clear colorless liquid with a strong odor of vinegar. It is a synthetic carboxylic acid with antibacterial and antifungal properties. Although its mechanism of action is not fully known, undissociated acetic acid may enhance lipid solubility allowing increased fatty acid accumulation on the cell membrane or in other cell wall structures. Acetic acid, as a weak acid, can inhibit carbohydrate metabolism resulting in subsequent death of the organism.</tr></table>");
resultTable[6] = new Array(resultStrTableStart+"<img src='images/gifs/butane.gif' width='390'><td class='mark' colspan='6'><b>Butane</b> is a colorless gas with a faint petroleum-like odor. It is shipped as a liquefied gas under its vapor pressure. Contact with the liquid can cause frostbite. It is easily ignited. Its vapors are heavier than air. It is used as a fuel, an aerosol propellant, in cigarette lighters, and to make other chemicals.</tr></table>");
resultTable[7] = new Array(resultStrTableStart+"<img src='images/gifs/propanone.gif' width='390'><td class='mark' colspan='6'><b>Propanone</b> or <b>Acetone</b> is a colorless liquid, used as a solvent and an antiseptic. Acetone occurs naturally in plants, trees, forest fires, vehicle exhaust and as a breakdown product of animal fat metabolism. This agent may be normally present in very small quantities in urine and blood; larger amounts may be found in the urine and blood of diabetics. Acetone is toxic in high doses.</tr></table>");
resultTable[8] = new Array(resultStrTableStart+"<img src='images/gifs/Methylamine.gif' width='390'><td class='mark' colspan='6'><b>Methylamine</b>, anhydrous is a colorless gas or a liquid. It has pungent fishy odor resembling odor of ammonia. Vapors are heavier than air and may collect in low-lying areas. It is easily ignited under most conditions. It's used for making pharmaceuticals, insecticides, paint removers, surfactants, rubber chemicals.</tr></table>");
resultTable[9] = new Array(resultStrTableStart+"<img src='images/gifs/Benzene.gif' width='390'><td class='mark' colspan='6'><b>Benzene</b> is a colorless and highly flammable liquid with a sweet smell. In industry benzene is used as a solvent, as a chemical intermediate, and is used in the synthesis of numerous chemicals. Because benzene has a high octane number, it is an important component of gasoline. Benzene is a known human carcinogen and is linked to an increased risk of developing lymphatic and hematopoietic cancers, acute myelogenous leukemia, as well as chronic lymphocytic leukemia.</tr></table>");
resultTable[10] = new Array(resultStrTableStart+"<img src='images/gifs/tetrachloromethane.gif' width='390'><td class='mark' colspan='6'><b>Tetrachloromethane</b> or <b>Carbon tetrachloride</b> is a solvent for oils, fats, lacquers, varnishes, rubber waxes, and resins, and a starting material in the manufacturing of organic compounds. Poisoning by inhalation, ingestion or skin absorption is possible and may be fatal.</tr></table>");
resultTable[11] = new Array(resultStrTableStart+"<img src='images/gifs/hex-2-yne.gif' width='390'><td class='mark' colspan='6'><b>Hex-2-yne</b> is highly harmful for humans and for the environment.</tr></table>");
resultTable[12] = new Array(resultStrTableStart+"<img src='images/gifs/2-methylpropanal.gif' width='390'><td class='mark' colspan='6'><b>2-methylpropanal</b> or <b>Isobutyl aldehyde</b> is a clear colorless liquid with a pungent odor. It is less dense than water and insoluble in water. Hence floats on water. Vapors are heavier than air. It is used to make other chemicals.</tr></table>");
resultTable[13] = new Array(resultStrTableStart+"<img src='images/gifs/ethylmethylether.gif' width='390'><td class='mark' colspan='6'><b>Ethylmethylether</b> Methoxyethane, also known as <b>ethyl methyl ether</b>, is an ethyl group with a bonded methoxy. Methoxyethane is a colorless gaseous ether with a medicine-like odor. It is extremely flammable, and its inhalation may cause asphyxiation or dizziness.</tr></table>");
resultTable[14] = new Array(resultStrTableStart+"<img src='images/gifs/ethylbutanoate.gif' width='390'><td class='mark' colspan='6'><b>Ethylbutanoate</b> is soluble in propylene glycol, paraffin oil, and kerosene. It has a fruity odor, similar to pineapple. It is commonly used as artificial flavoring resembling orange juice or pineapple in alcoholic beverages (e.g. martinis, daiquiris etc.), as a solvent in perfumery products, and as a plasticizer for cellulose. In addition, ethyl butyrate is often also added to orange juice, as most associate its odor with that of fresh orange juice.</tr></table>");
resultTable[15] = new Array(resultStrTableStart+"<img src='images/gifs/2-propenenitrile.gif' width='390'><td class='mark' colspan='6'><b>2-propenenitrile</b> or <b>Acrylonitrile</b> is a colorless, volatile liquid with a pungent, onion-like odor. It is a highly poisonous compound used widely used to produce rubber, resins, plastics, elastomers and synthetic fibers and to manufacture carbon fibers used in aircraft, defense and aerospace industries.</tr></table>");
resultTable[16] = new Array(resultStrTableStart+"<img src='images/gifs/3-buten-2-ol.gif' width='390'><td class='mark' colspan='6'><b>3-buten-2-ol</b> is highly harmful for humans and for the environment.</tr></table>");
resultTable[17] = new Array(resultStrTableStart+"<img src='images/gifs/4-methyl-2-pentanone.gif' width='390'><td class='mark' colspan='6'><b>4-methyl-2-pentanone</b> also known as <b>Methyl isobutyl ketone</b> is used as a solvent for gums, resins, paints, varnishes, lacquers, and nitrocellulose. Acute (short-term) exposure to methyl isobutyl ketone may irritate the eyes and mucous membranes, and cause weakness, headache, nausea, lightheadedness, vomiting, dizziness, incoordination, narcosis in humans.</tr></table>");
resultTable[18] = new Array(resultStrTableStart+"<img src='images/gifs/3-butenal.gif' width='390'><td class='mark' colspan='6'><b>3-butenal</b> is highly harmful for humans and for the environment.</tr></table>");
resultTable[19] = new Array(resultStrTableStart+"<img src='images/gifs/isobutylpropionate.gif' width='390'><td class='mark' colspan='6'><b>Isobutyl propionate</b> is a colorless liquid. It is less dense than water and it vapors heavier than air. It may be mildly toxic by ingestion, inhalation and skin absorption. It's used to make plastics.</tr></table>");
